window.bookSummaryJSON = "<p>Earth builds her first war fleet! </p> <p>The greatest warships ever constructed in known space rise up one by one, soon dominating our skies. They strike fear into the hearts of every citizen and rebel colonist alike. Captain William Sparhawk, the very man who convinced the secretive Council to build this terrifying fleet, now has doubts about the project. What is their exact mission? How could anyone have built these huge ships so quickly? And, most puzzling of all, what's happening out at the isolated laboratory complex on Phobos, Mars' lopsided moon? </p> <p>Learn the stunning truth in <i>Star Carrier</i>, the final book of the Lost Colonies Trilogy. </p>"; 
